select 
	--des.nome, mod.nome, count(esp.id)
	--esp.id, esp.id_usuario, extract(year from age(infess.data_nascimento)) as idade, esp.data, des.*, mod.* 
	'UPDATE historico_status_espera SET status = ''CANCELADO'' WHERE id=',hisstatesp.id as id_status,';', 'UPDATE espera SET justificativa_cancelamento = ''Retirado da lista de espera por exceder o limite de tempo. Em caso de interesse agendar serviço social. Executado manualmente pela TI.'' WHERE espera.id=', id_espera, ';' 
	from espera esp
	inner join usuario usu
		on esp.id_usuario = usu.id
	inner join informacao_essencial infess
		on usu.id_informacao_essencial = infess.id
	inner join espera_historico_status_espera esphisstaesp
		on esphisstaesp.id_espera = esp.id
	inner join historico_status_espera hisstatesp
		on hisstatesp.id = esphisstaesp.id_historico_status_espera
	inner join descricao_tipo_atendimento des
		on esp.id_descricao_tipo_atendimento = des.id
	inner join modulo mod
		on mod.id = esp.id_modulo
where hisstatesp.data_final_vigencia is null and hisstatesp.status = 'AGUARDANDO' and des.id in (39, 19, 37, 42, 17) and mod.id in (1, 37) and extract(year from age(infess.data_nascimento)) < 21 and esp.data between '01/01/0001' and '09/06/2015' and usu.id not in (
	select distinct aux.prontuario from(
			select usu.id as prontuario, infess.nome as nome_usuario, ate.data, ate.hora_inicio, ate.hora_termino, pro.nome as profissional, 'GRUPO' as categoria, infate.participacao as participacao, tip.nome as tipo, destipate.nome as descricao, mod.nome as modulo from grupo gru
				inner join grupo_modulo_periodo grumodper
					on gru.id = grumodper.id_grupo
				inner JOIN modulo_periodo modper
					ON grumodper.id_modulo_periodo = modper.id
				inner join descricao_tipo_atendimento destipate
					on (destipate.id = gru.id_descricao_tipo_atendimento)
				inner join tipo_atendimento tip
					on (tip.id = destipate.id_tipo_atendimento)
				inner JOIN modulo mod
					ON modper.id_modulo = mod.id
				inner JOIN modulo_periodo_atendimento_grupo modperaten
					ON modper.id = modperaten.id_modulo_periodo
				inner JOIN atendimento_grupo ate
					ON ate.id = modperaten.id_atendimento_grupo
				inner join atendimento_grupo_atendimento_usuario ategruateusu
					on ate.id = ategruateusu.id_atendimento_grupo
				inner join atendimento_usuario ateusu
					on ateusu.id = ategruateusu.id_atendimento_usuario
				inner join usuario usu
					on usu.id = ateusu.id_usuario
				inner join informacao_atendimento infate
					on infate.id = ateusu.id_informacao_atendimento
				inner join atendimento_grupo_atendimento_profissional ategruatepro
					on ategruatepro.id_atendimento_grupo = ate.id
				inner join atendimento_profissional atepro
					on atepro.id = ategruatepro.id_atendimento_profissional
				inner join profissional pro
					on pro.id = atepro.id_profissional
				inner join informacao_atendimento infatepro
					on infatepro.id = atepro.id_informacao_atendimento
				inner join informacao_essencial infess
					on infess.id = usu.id_informacao_essencial
			WHERE ate.status = 'NORMAL' and gru.excluido is false and infate.frequencia = 'AT' and infatepro.frequencia = 'AT' and ate.data between '09/06/2015' and '09/06/2017' 
		union all
		select usu.id as prontuario, infess.nome as nome_usuario, ateind.data, ateind.hora_inicio, ateind.hora_termino, pro.nome as profissional, 'INDIVIDUAL' as categoria, ateind.participacao as participacao, tip.nome as tipo, destipate.nome as descricao, mod.nome as modulo from atendimento_individual ateind
			left join usuario usu
				on usu.id = ateind.id_usuario
			inner join informacao_essencial infess
				on (infess.id = usu.id_informacao_essencial)
			inner join informacao_atendimento infate
				on infate.id = ateind.id_informacao_atendimento
			inner join descricao_tipo_atendimento destipate
				on (destipate.id = ateind.id_descricao_tipo_atendimento)
			inner join tipo_atendimento tip
				on (tip.id = destipate.id_tipo_atendimento)
			inner join modulo mod
				on (mod.id = ateind.id_modulo)
			inner join atendimento_individual_atendimento_profissional ateindatepro
				on ateindatepro.id_atendimento_individual = ateind.id
			inner join atendimento_profissional atepro
				on atepro.id = ateindatepro.id_atendimento_profissional
			inner join profissional pro
				on pro.id = atepro.id_profissional
			inner join informacao_atendimento infatepro
				on infatepro.id = atepro.id_informacao_atendimento
		where ateind.status = 'NORMAL' and infate.frequencia = 'AT' and infatepro.frequencia = 'AT' and ateind.data between '09/06/2015' and '09/06/2017' 
		)aux
	order by aux.prontuario
	)
--group by des.id, mod.id
order by esp.id_descricao_tipo_atendimento, esp.id_modulo, esp.id_usuario;


